CREATE OR REPLACE FUNCTION tmp.foo("table" text, "column" text, "geom" geometry)
RETURNS SETOF integer AS $$
BEGIN
RETURN QUERY EXECUTE 'SELECT count(*)::integer FROM ' || quote_ident($1) 
	|| ' WHERE ST_Intersects(' || $3::geometry ||', ' || quote_ident($2) || ');';
END;
$$ LANGUAGE plpgsql;

#include "stdafx.h"
#include "iostream"
#include "cstring"
#include "string"
#include <fstream>
using namespace std;


void main()
{
	string alphabeth = "abcdefghijklmnopqrstuvwxyz", key, key2, priv, priv2,zashifr="",unshifr="";
	cout << "Enter key: " << endl; getline(cin,key2);
	for (int i = 0; i < key2.length(); i++) {
		if (alphabeth.find(key2[i]) != string::npos) {
			key += key2[i];
		}
	}
	cout << "Enter open text: " << endl; getline(cin,priv2);
	for (int i = 0; i < priv2.length(); i++) {
		if (alphabeth.find(priv2[i]) != string::npos) {
			priv += priv2[i];
		}
	}
	for (int i = 0; i < priv.length(); i++) 
	{
		int a; a = i % key.length();
		int b = alphabeth.find(key[a]);
		int c = alphabeth.find(priv[i]);
		int d = (b + c) % alphabeth.length();
		zashifr += alphabeth[d];
	}
	cout << "Encrypted text: " << endl << zashifr << endl;
	for (int i = 0; i < zashifr.length(); i++)
	{
		int a; a = i % key.length();
		int b = alphabeth.find(key[a]);
		int c = alphabeth.find(zashifr[i]);
		int g = c - b;
		while (g < 0)
			g +=alphabeth.length();
		int d = g % alphabeth.length(); 
		unshifr += alphabeth[d];
	}
	cout << "Decrypted text: " << endl << unshifr << endl;
}
